import React, { useState, useEffect } from "react";

function App() {
  const [response, setResponse] = useState("initial state");

  useEffect(() => {
    fetch("/api").then(res => {
      if (res.ok) {
        return res.json();
      }
    }).then(responseData => setResponse(responseData.message));
  }, []);

  return (
    <div className="App">
      <h1>{response}</h1>
    </div>
  );
}

export default App;
